  \"Unmanned Aerial System and Spaceflight Microwave Radiometers? Radio-Frequency
  Interference Direct Detection and Science Data Recovery Based on the Hilbert-Huang
  Transform for Two Dimensions Project\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  41,\n\t\t\"recent\": 3\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:21:57.209911\",\n\t\"name\": \"unmanned-aerial-system-and-spaceflight-microwave-radiometers-radio-frequency-interference-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The three goals of this IRAD are:&lt;/p&gt;&lt;p&gt;1.1
  Research and develop the Hilbert-Huang Transform for 2D second and last component
  &amp;ndash; the Hilbert Spectral Analysis for 2D (HSA2) and complete the HHT2 theory;&lt;/p&gt;&lt;p&gt;1.2
  Develop the engineering tool for a direct decomposition of the RFI-contaminated
  signal into 2D or bi-dimensional Intrinsic Mode functions (BIMFs) and use the BIMFs
  to recover RFI-contaminated science data points by HSA2;&lt;/p&gt;&lt;p&gt;1.3 Verify
  the new technology tool prototype by a controlled drone experiment at Wallops, comprising
  a miniature radiometer, a controlled RFI source, and science data processing on
  the ground.&lt;/p&gt;\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
